import 'react-quill/dist/quill.snow.css';

export default function CreatePostPage() {
  return (
    <div>
      <form>
        <input title="title" placeholder={'Title'}></input>
        <input title="summary" placeholder={'Summary'}></input>
        <input title="file" />
        <ReactQuill/>
      </form>
    </div>
  )
}

